The magnificent BMW Art Car V12 LMR Jenny Holzer —  built for the racetrack, but perfect for the stage. See artist Jenny Holzer’s masterwork in all its glory at Munich’s Bayerische Staatsoper, shot by good friend of BMW Group Classic Daniel Nikodem.

@bmwjogge @bayerischestaatsoper @bmwgroupculture @jennyholzerstudio
