It’s the 1957 BMW Isetta 600, straight from the Goodwood Revival! Once owned by Sir Stirling Moss himself, this microcar was the brand’s first post-war four-seater, and a pioneer of design that would lead to later icons like the BMW 700. This particular model even packs the larger engine from the 700, put there after it fell into Sir Moss’ hands.

And after 15 years hiding in a private collection, it’s now been fully restored — back to its former, stunning glory!

